export const getUserPersonalController = async (req, res) => {
    try {
        const { id }  = req.params
        const result = await getUserPersonalService(id)
        return res.status(200).json(result)
    } catch (error) {
        console.log(error) 
        res.status(500).send({
            status: false, 
            message: 'Có lỗi xảy ra!', 
            error
        })
    }
}

